class NameBar extends React.Component {

  render() {
    return (
      <div>
          <form>
            <input type="text" id="fname" name="fname" placeholder="Enter your name"/>
            <button className="submitName">{this.handleSubmit}</button>
          </form>
      </div>
    );
  }
}

export default NameBar;
